import React from 'react'
import './Section.css'
import { IphoneGraphicBlock } from './IphoneGraphicBlock.jsx'
import { WebGraphicBlock } from './WebGraphicBlock.jsx'

export const Section = (props) => {
  const leftGraphicBlock =
    props.leftGraphicBlock != 'iphone' ? (
      <IphoneGraphicBlock image={props.leftIcon} />
    ) : props.leftGraphicBlock != 'web' ? (
      <WebGraphicBlock image={props.leftIcon} />
    ) : null
  return (
    <section>
      <div className="left-graphic-block">{leftGraphicBlock}</div>
      <div className="left-indicator-block"></div>
      <div className="">{props.text}</div>
      <div className="right-indicator-block"></div>
      <div className="right-graphic-block"></div>
    </section>
  )
}
